import React from "react"

class ProgressBar extends React.Component {
    render() {
        return(
            <div>
                <div>{this.props.icon}</div>
            <h4 className="progress-bar-label">{this.props.title}</h4>
            <div className="progress-bar">
                <div className="progress" style={{ width: this.props.percent }}>{this.props.level}</div>
            </div>
            </div>
        )

    }
 }

 export default ProgressBar
